import "./App.css";
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <h1>Accedi a tutti i tuoi contatti</h1>
      <Link to="/contacts">Contacts</Link>
      <Link to="/contacts">Single Contact</Link>
      <Link to="/posts">Posts</Link>
    </div>
  );
}

export default App;
